import styled from 'styled-components';

export const Container = styled.div`
  margin: 0 auto;
  justify-content: center;
  align-items: center;
  max-width: 900px;
`;
export const Content = styled.div``;
export const Title = styled.div`
  margin: 40px 0;

  strong {
    font-size: 20px;
    color: #444;
  }
`;
export const PageActions = styled.div`
  display: flex;
  justify-content: space-between;

  input {
    height: 36px;
    width: 230px;
    padding: 0 5px;

    border: 1px solid #eee;
    border-radius: 4px;
  }

  button {
    justify-content: center;
    align-items: center;
    background: #7d40e7;
    padding: 5px;
    width: 140px;

    border: 0;
    border-radius: 4px;

    strong {
      color: #fff;
    }
  }
`;
